'use strict';(function(){const indexCfg={encode:false,tokenize:function(str){return str.replace(/[\x00-\x7F]/g,'').split('');}};indexCfg.doc={id:'id',field:['title','content'],store:['title','href','section'],};const index=FlexSearch.create('balance',indexCfg);window.newdocsSearchIndex=index;index.add({'id':0,'href':'/zh/docs/api/api-endpoints/','title':"API Endpoints",'section':"API 文档",'content':"API Endpoints #  我们为 NewBridge 提供了公共 API 地址。\nNewBridge Core API #  NewBridge Core API 为 NewBridge 应用程序和第三方应用程序提供查询服务以使用 NewBridge。 有Production和Test两种不同的 environments。\nProduction 环境为每个区块链的 主网 运行。\nTest 环境是以测试为目的，仅支持选定的 测试网 。\nProduction Networks #  https://api.end.point.to.be.replaced\nTest Networks #  https://api.end.point.to.be.replaced\n测试网 上的转换仅用于测试目的。  XChain API #  目前，Newton Project 没有提供公共的 XChain API 端点。\n"});index.add({'id':1,'href':'/zh/docs/architecture/','title':"架构",'section':"文档",'content':"架构 #  NewBridge 包含如下多个组件：\n NewBridge Core  Validator   Secure Vault  Collection Payout   Monitor APIs  NewBridge Service API XChain API    架构图:\n Monitor #  每个链均有各自的检测程序，检测程序会基于币种信息来检测系统内对应地址的收款情况。\nSecure Vault #  Collection #  资金归并程序，每个链均有各自的归并程序；\n 归并方式  native 针对类似 ETH/NEW 的资金，直接转账到离线钱包 burnable 针对可销毁的 token，采用 burn 来销毁 token，不进行归并，一般针对跨链后的币种 transfer 一般 token 采用 transfer 到离线钱包    Payout #  每个链均有一个支出程序，给用户兑付相应的 token\n native 原生 coin 采用普通转账方式，由 MainAddress 统一转出 mintable 针对可铸币的 token，由 MainAddress 调用 mint 函数进行铸币 transfer 针对普通 token，由 MainAddress 从自己地址转出 token 到目标地址  NewBridge Core (validator) #  NewBridge Core 用来协调各条区块链程序的用户充值、手续费、兑付等程序；\n 输入  用户充值地址 系统内收币地址 金额   输出  用户收币地址 金额    "});index.add({'id':2,'href':'/zh/docs/api/','title':"API 文档",'section':"文档",'content':"NewBridge API 文档 #  欢迎使用面向开发人员的 NewBridge API 文档。\n简介 #  加入正在构建下一代跨链服务的开发人员的行列。 我们全面的文档和指南可帮助您探索 NewBridge API 和功能，并尽快集成以使用 NewBridge。\n前端 APIs #   API Endpoints API Endpoints for NewBridge\n   (Core) Pairs Info API 查找不同桥接方向的链和资产的桥接对\n   (Core) Account API 查找用户地址的存款地址\n   (Core) Account History API 返回一个JSON结构，其中包含指定帐户的NewBridge桥接历史记录的详细信息\n   (XChain) 创建账户 NewBridge 的 API Endpoints\n   XChain API #  Chain API 是运行在 main api 及 newbridge core后端的程序，其接口以 grpc 定义。\nChainAPI 服务定义如下：\n// The ChainAPI service definition. service ChainAPI { rpc CreateAccount (CreateAccountRequest) returns (CreateAccountReply) {} }   CreateAccount  "});index.add({'id':3,'href':'/zh/docs/api/pairs/','title':"(Core) Pairs Info API",'section':"API 文档",'content':"GET Pairs Info #  GET /v1/newbridge/pairs\n返回 account 的账户基本信息\nAPI parameters #  请求参数 #   无  curl -v https://replace-api-domain.ext/newbridge/pairs 返回参数 #  { \u0026#34;pairs\u0026#34;: [ { \u0026#34;newchain_asset\u0026#34;: { \u0026#34;address\u0026#34;: \u0026#34;NEW17zFMb1iNPuFKbgW3ZPEJ3iLZrWvRjYmxCzG\u0026#34;, \u0026#34;raw_address\u0026#34;: \u0026#34;0x20F12218281F9CA566B5c41F17c6c19050125cD3\u0026#34;, \u0026#34;name\u0026#34;: \u0026#34;NewUSDT\u0026#34;, \u0026#34;symbol\u0026#34;: \u0026#34;NUSDT\u0026#34;, \u0026#34;decimals\u0026#34;: 6, \u0026#34;asset_type\u0026#34;: \u0026#34;NRC6\u0026#34;, \u0026#34;chain_id\u0026#34;: \u0026#34;1007\u0026#34;, \u0026#34;sub_network\u0026#34;: \u0026#34;Testnet\u0026#34; }, \u0026#34;ethereum_asset\u0026#34;: { \u0026#34;address\u0026#34;: \u0026#34;0x0f3229fEEEB7e96493482b70DF3024822F01AA01\u0026#34;, \u0026#34;raw_address\u0026#34;: \u0026#34;0x0f3229fEEEB7e96493482b70DF3024822F01AA01\u0026#34;, \u0026#34;name\u0026#34;: \u0026#34;Tether USD\u0026#34;, \u0026#34;symbol\u0026#34;: \u0026#34;USDT\u0026#34;, \u0026#34;decimals\u0026#34;: 6, \u0026#34;asset_type\u0026#34;: \u0026#34;ERC20\u0026#34;, \u0026#34;chain_id\u0026#34;: \u0026#34;4\u0026#34;, \u0026#34;sub_network\u0026#34;: \u0026#34;Rinkeby\u0026#34; }, \u0026#34;new2eth_min_deposit_amount\u0026#34;: \u0026#34;10\u0026#34;, \u0026#34;eth2new_min_deposit_amount\u0026#34;: \u0026#34;1\u0026#34;, \u0026#34;new2eth_fee_percent\u0026#34;: \u0026#34;0.000000\u0026#34;, \u0026#34;eth2new_fee_percent\u0026#34;: \u0026#34;0.000000\u0026#34;, \u0026#34;new2eth_fee_min_amount\u0026#34;: \u0026#34;1\u0026#34;, \u0026#34;eth2new_fee_min_amount\u0026#34;: \u0026#34;0\u0026#34; } ] }    名称 类型 描述     newchain_asset Token 交接对中 newchain 资产   ethereum_asset Token 桥接对中 ethereum 的资产   new2eth_min_deposit_amount string new2eth方向最小充值金额   eth2new_min_deposit_amount string eth2new方向最小充值金额   new2eth_fee_percent string new2eth方向手续费的百分比。实际手续费为 new2eth_fee_percent 和 new2eth_fee_min_amount计算后得到的最大值。   eth2new_fee_percent string eth2new方向手续费的百分比。实际手续费为 eth2new_fee_percent 和 eth2new_fee_min_amount 计算后得到的最大值。   new2eth_fee_min_amount string new2eth方向手续费最小值   eth2new_fee_min_amount string eth2new方向手续费的最小值    其中， Token 类型定义如下：\n   名称 类型 描述     address string 合约地址。ethereum 里 0x 格式，newchain 里 NEW 开头格式。如果为原生币（ETH/NEW），则为空。   raw_address string 合约地址原生格式，0x 格式   name string token 的名称   symbol string token 的符号   decimals uint8 token 的精度，一般取值范围为 [0,18]。两个链上的精度必须一致。   asset_type string 资产类型，newchain 链取值为 ： Coin,ERC6, ethreum 链取值为 Coin,ERC20   chain_id int 链的 ChainID   sub_network string 链的子名称，newchain 链可取值有： Mainnet,Testnet,ethereum 链可取值为：Mainnet,Rinkeby    Error Codes #     Status Code Description Params     400 account_not_found Acount was not found    400 address_is_in_invalid_format Requested address format is not valid { \u0026ldquo;type\u0026rdquo; =\u0026gt; \u0026ldquo;newchain_address\u0026rdquo; } or { \u0026ldquo;type\u0026rdquo; =\u0026gt; \u0026ldquo;ethereum_address\u0026rdquo; }   429 too_many_requests Too many requests have been made to the api.    500 internal_server_error Internal server error    503 service_unavailable Service is temporary unavailable     "});index.add({'id':4,'href':'/zh/docs/api/account/','title':"(Core) Account API",'section':"API 文档",'content':"GET Account Info #  **GET /v1/newbridge/account\n返回 account 的账户基本信息\nAPI parameters #  请求参数 #     Name In Type Description Enum Default     direction query string new2eth或者eth2new之一，强制接口指定跨链方向，防止地址与方向混淆。     ethereum_recipient_address query string new2eth方向上，用户在 ethereum 链上的收币地址。     newchain_recipient_address query string eth2new方向上，用户在 newchain 链上的收币地址，可以是 NEW 开头的地址或者 0x 开头的原生格式。      curl -v https://replace-api-domain.ext/newbridge/account?ethereum_recipient_address=0xad61cc6653B62b7C05Bd2F593Bc49d22Fb901A9c\u0026amp;direction=new2eth 返回参数 #  { \u0026#34;ethereum_recipient_address\u0026#34;: \u0026#34;0xad61cc6653B62b7C05Bd2F593Bc49d22Fb901A9c\u0026#34;, \u0026#34;newchain_recipient_raw_address\u0026#34;: \u0026#34;\u0026#34;, \u0026#34;direction\u0026#34;: \u0026#34;new2eth\u0026#34;, \u0026#34;newchain_deposit_address\u0026#34;: \u0026#34;NEW17zLJnGFnhi9b3yPUanjiieXknCirQhNwWE1\u0026#34;, \u0026#34;newchain_deposit_raw_address\u0026#34;: \u0026#34;0x5741E7e542828DF38A888bcc9b8f9500e4331420\u0026#34; }    名称 类型 描述     ethereum_recipient_address string new2eth方向，用户在 ethereum 链上的收币地址。   newchain_recipient_address string eth2new方向，用户在 newchain 链上的收币地址，NEW 开头的地址。   newchain_recipient_raw_address string eth2new方向，用户在 NewChain 链上的收币地址的 Raw 格式，0x 开头   direction string new2eth或者eth2new之一   ethereum_deposit_address string eth2new方向，ethereum 链上的冲币地址   newchain_deposit_address string new2eth方向，newchain 链上的冲币地址，NEW 开头的地址   newchain_deposit_raw_address string new2eth方向， newchain 链上的冲币地址，0x 开头的原生格式    Error Codes #     Status Code Description Params     400 account_not_found Acount was not found    400 address_is_in_invalid_format Requested address format is not valid { \u0026ldquo;type\u0026rdquo; =\u0026gt; \u0026ldquo;newchain_address\u0026rdquo; } or { \u0026ldquo;type\u0026rdquo; =\u0026gt; \u0026ldquo;ethereum_address\u0026rdquo; }   429 too_many_requests Too many requests have been made to the api.    500 internal_server_error Internal server error    503 service_unavailable Service is temporary unavailable     "});index.add({'id':5,'href':'/zh/docs/api/history/','title':"(Core) Account History API",'section':"API 文档",'content':"(Core) Account History API #  GET Account History #  GET /v1/newbridge/history\n返回一个 JSON 结构，其中包含指定帐户的 NewBridge 桥接历史记录的详细信\nAPI parameters #  请求参数 #     名称 In 类型 描述 Enum Default     newchain_address query string NewChain 的地址，可以是 NEW 开头或者 0x 开头的地址。newchain_address 和 ethereum_address 至少需要一个。     ethereum_address query string 0x 开头的 ethereum 地址。newchain_address 和 ethereum_address 至少需要一个。      Optional #     Name In Type Description Enum Default     page_id query integer Page number.     page_size query integer Number of results per page.      curl -v https://replace-api-domain.ext/newbridge/history?newchain_address=0x97549E368AcaFdCAE786BB93D98379f1D1561a29\u0026amp;page_size=1 返回 200 #  { \u0026#34;newchain_address\u0026#34;: \u0026#34;NEW17zS9ZvgGV1EaT8KT2tLjqRvQbcApjFot8xj\u0026#34;, \u0026#34;newchain_raw_address\u0026#34;: \u0026#34;0x97549E368AcaFdCAE786BB93D98379f1D1561a29\u0026#34;, \u0026#34;page_id\u0026#34;: \u0026#34;1\u0026#34;, \u0026#34;page_size\u0026#34;: \u0026#34;1\u0026#34;, \u0026#34;total_page\u0026#34;: \u0026#34;6\u0026#34;, \u0026#34;total_history\u0026#34;: \u0026#34;53\u0026#34;, \u0026#34;list\u0026#34;: [ { \u0026#34;from_network\u0026#34;: \u0026#34;Ethereum\u0026#34;, \u0026#34;from_sub_network\u0026#34;: \u0026#34;Rinkeby\u0026#34;, \u0026#34;from_chain_id\u0026#34;: \u0026#34;4\u0026#34;, \u0026#34;to_network\u0026#34;: \u0026#34;NewChain\u0026#34;, \u0026#34;to_sub_network\u0026#34;: \u0026#34;Testnet\u0026#34;, \u0026#34;to_chain_id\u0026#34;: \u0026#34;1007\u0026#34;, \u0026#34;from_address\u0026#34;: \u0026#34;0xad61cc6653B62b7C05Bd2F593Bc49d22Fb901A9c\u0026#34;, \u0026#34;from_raw_address\u0026#34;: \u0026#34;0xad61cc6653B62b7C05Bd2F593Bc49d22Fb901A9c\u0026#34;, \u0026#34;to_address\u0026#34;: \u0026#34;NEW17zS9ZvgGV1EaT8KT2tLjqRvQbcApjFot8xj\u0026#34;, \u0026#34;to_raw_address\u0026#34;: \u0026#34;0x97549E368AcaFdCAE786BB93D98379f1D1561a29\u0026#34;, \u0026#34;from_tx_hash\u0026#34;: \u0026#34;0xad9716fdd2ae16840a96360e54dd683511a20a68c9e855c58ea333a3930206b2\u0026#34;, \u0026#34;from_asset_type\u0026#34;: \u0026#34;Token\u0026#34;, \u0026#34;from_asset_name\u0026#34;: \u0026#34;TestNet Launch\u0026#34;, \u0026#34;from_asset_symbol\u0026#34;: \u0026#34;TL\u0026#34;, \u0026#34;from_asset_address\u0026#34;: \u0026#34;0xCc5b1517bae326F8E147D6bEd17F5F53bc2f85c5\u0026#34;, \u0026#34;to_tx_hash\u0026#34;: \u0026#34;0x54b61d26348c2f6b71866620325c3ec39eaa8c5d1488cecc7f5b28422583bcc9\u0026#34;, \u0026#34;to_asset_type\u0026#34;: \u0026#34;Token\u0026#34;, \u0026#34;to_asset_name\u0026#34;: \u0026#34;TestNet Launch\u0026#34;, \u0026#34;to_asset_symbol\u0026#34;: \u0026#34;TL\u0026#34;, \u0026#34;to_asset_address\u0026#34;: \u0026#34;0x243a5C81C1F9970aa3e6f51d73fC13eE853FC338\u0026#34;, \u0026#34;amount_requested\u0026#34;: \u0026#34;14\u0026#34;, \u0026#34;amount_fulfilled\u0026#34;: \u0026#34;14\u0026#34;, \u0026#34;fee\u0026#34;: \u0026#34;0\u0026#34;, \u0026#34;status\u0026#34;: \u0026#34;Confirmed\u0026#34; } ] }    Name Type Description     newchain_address String NEW开头的 NewChain 地址。 newchain_address 或者 ethereum_address 之中的一个会被返回。   ethereum_address String 0x开头的 ethereum 地址。 newchain_address 或者 ethereum_address 之中的一个会被返回。   newchain_raw_address String 0x开头的 NewChain 地址   page_id int 页编号。   page_size int 页大小。   total_page int 总页数   total_history int 总结果数   list BridgeHistory BridgeHistory 类型的数组    Error Codes #     Status Code Description Params     400 account_not_found Acount was not found    400 address_is_in_invalid_format Requested address format is not valid { \u0026ldquo;type\u0026rdquo; =\u0026gt; \u0026ldquo;newchain_address\u0026rdquo; } or { \u0026ldquo;type\u0026rdquo; =\u0026gt; \u0026ldquo;ethereum_address\u0026rdquo; }   429 too_many_requests Too many requests have been made to the api.    500 internal_server_error Internal server error    503 service_unavailable Service is temporary unavailable     "});index.add({'id':6,'href':'/zh/docs/api/create-account/','title':"(XChain) 创建账户",'section':"API 文档",'content':"Create Account #  rpc CreateAccount (CreateAccountRequest) returns (CreateAccountReply) {} API parameters #  Required #  message CreateAccountRequest { string name = 1; }    Name Type Description     name string 另一个链上的用户的收款地址    Response #  message CreateAccountReply { string name = 1; string address = 2; // the address to deposit }    Name Type *Description**     name string 另一个链上的用户的收款地址   address string 当前链上的用户的存款地址    "});index.add({'id':7,'href':'/zh/faq/','title':"常见问题",'section':"Home",'content':"常见问题 #  什么是 NewBridge? #  NewBridge 跨链技术实现了 NewChain 和其他区块链间的数字资产互通，现已支持 NewChain 和以太坊之间的三种通证 NEW、USDT、ETH 互通，以后会陆续增加更多资产。\nNewBridge 能做什么？ #  NewBridge 实现了 NewChain 和其他区块链间的数字资产互通，即: 可以将你的 ETH 通过 NewBridge 跨链到 NewChain，使用 NETH 参与牛顿生态，例如在 NewSwap 提供 NETH-NEW 的交易对，进行流动性挖矿; 可以将 NEW 通过 NewBridge 跨链到以太坊，使用 WNEW 参与以太坊生态等等\u0026hellip;\nNewBridge 怎么用? #  使用前提:\n  浏览器中使用: 需要安装浏览器插件 Chrome 插件 或者 Firefox 插件。\n  手机中操作，需要下载 NewPay。\n  将 NewChain 资产转移到以太坊: #  确保要转移的资产在 NewChain 上的余额充足，在目标地址的输入框中输入以太坊钱包的地址，输入转账额度，点击跨链转出, 然后会弹出授权转账页面，确认授权，即可将 NewChain 上的资产转移到以太坊上的对应地址。\n将以太坊资产转移到 NewChain: #  切换资产方向，会看到一个二维码，使用以太坊钱包，将要转移的以太坊资产转移到该二维码对应地址中(点击可以复制地址)即可。\n"});index.add({'id':8,'href':'/zh/docs/','title':"文档",'section':"Home",'content':"文档 #  该网站上有几种类型的文档：\n浏览文档 #   架构 NewChain基本架构\n   API 文档 NewBridge API 文档\n   "});})();